import React from 'react';
import { NavLink } from 'react-router-dom';
import Logo from "./img/logo.png"
import {Nav , Navbar , Container , Offcanvas , NavDropdown , Form ,FormControl , Button} from "react-bootstrap"






const nav = () =>{
  return (
    <div>




<Navbar bg="light" expand="lg">
  <Container fluid>
    <Navbar.Brand href="#">Navbar scroll</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
      <Nav
        className="ml-auto my-2 my-lg-0"
        // style={{ maxHeight: '100px' }}
        // navbarScroll
      >
        <Nav.Link href="#action1">Home</Nav.Link>
                <Nav.Link href="#action2">About Us</Nav.Link>  
                <Nav.Link href="#action3">Explore Foods</Nav.Link>  
                <Nav.Link href="#action5">Reviews</Nav.Link>  
                <Nav.Link href="#action5">FAQ</Nav.Link>
                <Nav.Link href="#action6" className="btn btn-outline-primary"><a href='tel:"+123456789"'>+123-456-789</a></Nav.Link> 
      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>

    </div>
  );
}

export default nav;
